// frontend/src/components/UserProfileMatches.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

function UserProfileMatches() {
  const { id } = useParams();  // Extracts the user ID from the URL
  const [matches, setMatches] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Ensure that `id` is an integer if it's not already
    const userId = parseInt(id, 10);

    axios.get(`http://localhost:8000/api/matchmaking/${userId}/`)
      .then(response => {
        console.log(response.data);  // Debugging line
        setMatches(response.data);
      })
      .catch(error => {
        console.error('Error fetching matches:', error);
        setError('Error fetching matches.');
      });
  }, [id]);

  return (
    <div>
      <h1>Matches for User {id}</h1>
      {error && <p>{error}</p>}
      <ul>
        {matches.length ? (
          matches.map(match => (
            <li key={match.user.id}>
              Match: {match.user.username}  {/* Example detail */}
            </li>
          ))
        ) : (
          <p>No matches available.</p>
        )}
      </ul>
    </div>
  );
}

export default UserProfileMatches;
